import React from "react";
import "./style.css";

function Jumbotron(props) {
  return (
    <div className="jumbotron jumbotron-fluid">
  <div className="container">

    <h1 className="display-4">
    <span className="myBlueB">B</span>
    <span className="myRedO">o</span>
    <span class="myYellowO">o</span>
    <span class="myGreenK">k</span>
    <span class="myBlueS">s</span>
    <span class="myPurpleT">t</span>
    <span class="myPinkE">e</span>
    <span class="myYellowR">r</span>
    </h1>
    <p class="lead">Google Books' lesser known, and definitely not as cute, cousin.</p>
  </div>
</div>
  );
}

export default Jumbotron;
